      {
        image: 'https://foo.com/bar.png',
        amount: 0.2,
        slowerScrollRate: false,
      },]}
      style={{
          height: '500px',
      }}
      >
      <h1>Banner Children</h1>
    </ParallaxBanner>

    <MDBContainer>
      <MDBRow>
